import { Avatar, Paper } from '@mui/material';
import React from 'react';


function Home() {
  return (
    <div className="app">
      <div className="header"></div>
      <div className="main">
        <div className="box"></div>
        <div className="content">
          <div className="card"></div>
          <div className="card"></div>
          <div className="card"></div>
          <div className="card"></div>
        </div>
      </div>
      <div className="navbar">
        <div className="nav-icon"></div>
        <div className="nav-icon"></div>
        <div className="nav-icon"></div>
        <div className="nav-icon"></div>
      </div>
    </div>
  );
}

export default Home;
